const Users = ({ users }) => {
  console.log('USERS', users);
  return (
    <ul className="list-group">
      {users.map((user) => (
        <li className="list-group-item">
          <h5>{user.name}</h5>
        </li>
      ))}
    </ul>
  );
};

export default Users;
